[{"location":"#NSDEBase.jl","page":"Home","title":"NSDEBase.jl","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"This is the documentation of NSDEBase.jl, a Julia package containing shared types and functions of NSDE.jl and its sub-packages.","category":"page"},{"location":"#Manual","page":"Home","title":"Manual","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Depth = 3","category":"page"},{"location":"#API","page":"Home","title":"API","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Only exported types and functions are considered a part of the public API of NSDEBase. All such objects should be documented in this manual.","category":"page"},{"location":"#Types","page":"Home","title":"Types","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"NSDEProblem\nNSDESolver\nNSDESolution\nRightHandSideFunction\nInitialValueProblem\nInitialValueSolver\nInitialValueSolution","category":"page"},{"location":"#NSDEBase.NSDEProblem","page":"Home","title":"NSDEBase.NSDEProblem","text":"Abstract type for problems solved with NSDE.jl\n\n\n\n\n\n","category":"type"},{"location":"#NSDEBase.NSDESolver","page":"Home","title":"NSDEBase.NSDESolver","text":"Abstract type for solvers from NSDE.jl\n\n\n\n\n\n","category":"type"},{"location":"#NSDEBase.NSDESolution","page":"Home","title":"NSDEBase.NSDESolution","text":"Abstract type for solutions of problems solved with NSDE.jl\n\n\n\n\n\n","category":"type"},{"location":"#NSDEBase.RightHandSideFunction","page":"Home","title":"NSDEBase.RightHandSideFunction","text":"RightHandSideFunction{f_T, f!_T, Df_T, Df!_T}\n\nreturns a constructor for the right-hand side of an InitialValueProblem.\n\n\n\nRightHandSideFunction(f, f!, Df, Df!)\nRHS(args...; kwargs...)\n\nreturns a RightHandSideFunction with:\n\nf   :: Function : right-hand side derivative.\nf!  :: Function : right-hand side derivative (in-place).\nDf  :: Function : jacobian of right-hand side derivative.\nDf! :: Function : jacobian of right-hand side derivative (in-place).\n\n\n\nRightHandSideFunction(f!_or_f::Function)\nRHS(args...; kwargs...)\n\nchecks whether f!_or_f is in-place or not, and then returns a RightHandSideFunction with its fields constructed accordingly.\n\n\n\n\n\n","category":"type"},{"location":"#NSDEBase.InitialValueProblem","page":"Home","title":"NSDEBase.InitialValueProblem","text":"InitialValueProblem{rhs_T, u0_T, tspan_T} <: NSDEProblem\n\nreturns a composite type for initial value problems.\n\n\n\nInitialValueProblem(rhs, u0, tspan)\nIVP(args...; kwargs...)\n\nreturns an InitialValueProblem with:\n\nrhs   :: Union{Function, RightHandSideFunction} : right-hand side derivative.\nu0    :: Union{Number, AbstractVector{Number}}  : initial condition.\ntspan :: Tuple{Real, Real}                      : time domain.\n\n\n\nInitialValueProblem(rhs, u0, t0::Real, tN::Real)\nIVP(args...; kwargs...)\n\nreturns an InitialValueProblem with tspan = (t0, tN).\n\n\n\n\n\n","category":"type"},{"location":"#NSDEBase.InitialValueSolver","page":"Home","title":"NSDEBase.InitialValueSolver","text":"Abstract type for solvers of initial value problems from NSDE.jl\n\n\n\n\n\n","category":"type"},{"location":"#NSDEBase.InitialValueSolution","page":"Home","title":"NSDEBase.InitialValueSolution","text":"Abstract type for solutions of initial value problems from NSDE.jl\n\n\n\n\n\n","category":"type"},{"location":"#ODEs","page":"Home","title":"ODEs","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Dahlquist\nLogistic\nRiccati\nSimplePendulum\nVanderPol\nRössler\nLorenz\nLorenz96","category":"page"},{"location":"#NSDEBase.Dahlquist","page":"Home","title":"NSDEBase.Dahlquist","text":"Dahlquist(u0 = 1.0, tspan = (0.0, 1.0); λ = 1.0) :: InitialValueProblem\n\nreturns an InitialValueProblem for the Dahlquist equation.\n\n\n\n\n\n","category":"function"},{"location":"#NSDEBase.Logistic","page":"Home","title":"NSDEBase.Logistic","text":"Logistic(u0 = 0.5, tspan = (0.0, 5.0); λ = 1.0) :: InitialValueProblem\n\nreturns an InitialValueProblem for the Logistic equation.\n\n\n\n\n\n","category":"function"},{"location":"#NSDEBase.Riccati","page":"Home","title":"NSDEBase.Riccati","text":"Riccati(u0 = 0.0, tspan = (0.0, 5.0)) :: InitialValueProblem\n\nreturns an InitialValueProblem for the Riccati equation.\n\n\n\n\n\n","category":"function"},{"location":"#NSDEBase.SimplePendulum","page":"Home","title":"NSDEBase.SimplePendulum","text":"SimplePendulum(u0 = [0.0, π/2], tspan = (0.0, 2π); g = 1.0, L = 1.0) :: InitialValueProblem\n\nreturns an InitialValueProblem for the simple pendulum problem.\n\n\n\n\n\n","category":"function"},{"location":"#NSDEBase.VanderPol","page":"Home","title":"NSDEBase.VanderPol","text":"VanderPol(u0 = [1.0; 0.0], tspan = (0.0, 5.0); μ = 1.0) :: InitialValueProblem\n\nreturns an InitialValueProblem for the Van der Pol equation (in first-order form).\n\n\n\n\n\n","category":"function"},{"location":"#NSDEBase.Rössler","page":"Home","title":"NSDEBase.Rössler","text":"Rössler(u0 = [2.0, 0.0, 0.0], tspan = (0.0, 10.0); a = 0.2, b = 0.2, c = 5.7) :: InitialValueProblem\n\nreturns an InitialValueProblem for the Rössler equations.\n\n\n\n\n\n","category":"function"},{"location":"#NSDEBase.Lorenz","page":"Home","title":"NSDEBase.Lorenz","text":"Lorenz(u0 = [2.0, 3.0, -14.0], tspan = (0.0, 10.0); σ = 10.0, β = 8/3, ρ = 28.0) :: InitialValueProblem\n\nreturns an InitialValueProblem for the Lorenz equations.\n\n\n\n\n\n","category":"function"},{"location":"#NSDEBase.Lorenz96","page":"Home","title":"NSDEBase.Lorenz96","text":"Lorenz96(u0, tspan; F = 8) :: InitialValueProblem\n\nreturns an InitialValueProblem for the Rössler equations.\n\n\n\n\n\n","category":"function"},{"location":"#Index","page":"Home","title":"Index","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"","category":"page"}]
